import React from 'react'
import './profile.css'

const Profile__logo = ({image}) => {
    return (
        <div className="profile__logo-container">
            <div className="profile__logo" onClick={() => {}}>
                <img src={ image } alt="profile-logo" />
            </div>
        </div>
    )
}

const Profile = ({image, username, name, action, CHnW, HnW}) => {
    return (
        <div className="suggestions">
            <div className="profile__logo-container" style={{width: { CHnW }, height: { CHnW } }}> 
                <div className="profile__logo" onClick={() => {}} style={{width: { HnW }, height:{ HnW } }}> 
                    <img src={ image } alt="profile-logo" />
                </div>
            </div>
            <div className="profile__user">
                <div className="profile__user-container">
                    <div className="profile__username" onClick={() => {}}>
                        { username}
                    </div>
                    <div className="profile__user-name">
                        { name }
                    </div>
                </div>
                <div className="profile__action" onClick={() => {}}>
                    { action }
                </div>
            </div>
        </div>
    )
}

export default Profile
